    }

    valOfSearchList = (value) => {
        this.props.onApplySearch(value);
    }

    render() {
        return (

            <Search
                placeholder="input search text"
                onSearch={this.valOfSearchList}
                style={{ width: 200 }}
            />
        );
    }
}


